INSERT INTO AwardShow (ShowName, Description, Year, Type, Criteria, VotingPanel) VALUES ('Oscars', 'The Academy Awards or The Oscars is an annual American awards ceremony honoring cinematic achievements in the film industry.', 1929, 'Movies', 'https://web.archive.org/web/20131110071910/http://www.oscars.org/awards/academyawards/rules/rule02.html | http://www.oscars.org/oscars/rules-eligibility', 'The Academy of Motion Picture Arts and Sciences (AMPAS)');
INSERT INTO AwardShow (ShowName, Description, Year, Type, Criteria, VotingPanel) VALUES ('Emmys', 'An Emmy Award, or simply Emmy, recognizes excellence in the television industry, and corresponds to the Academy Award, the Tony Award, and the Grammy Award.', 1949, 'Television', 'http://www.emmys.com/sites/default/files/Downloads/pte14_rulesandproced_v4.pdf', 'Television Academy');
INSERT INTO AwardShow (ShowName, Description, Year, Type, Criteria, VotingPanel) VALUES ('Tonys', 'The Antoinette Perry Award for Excellence in Theatre, more commonly known informally as the Tony Award, recognizes achievement in live Broadway theatre.', 1947, 'Stage', 'http://www.tonyawards.com/pdf/2014_Tony_Rules_Regulations_April_25.pdf', 'Representatives of any of the many groups: http://www.tonyawards.com/en_US/about/rules.html');
INSERT INTO AwardShow (ShowName, Description, Year, Type, Criteria, VotingPanel) VALUES ('Grammys', 'A Grammy Award, or Grammy, is an accolade by the National Academy of Recording Arts and Sciences of the United States to recognize outstanding achievement in the music industry.', 1959, 'Music', 'http://www.grammy.org/recording-academy/awards/grammy-awards-voting-process', 'Recording Academy');
