CREATE TABLE AwardShow( ShowName VARCHAR(100) PRIMARY KEY, Description VARCHAR(2000), Year INT, Type VARCHAR(100), Criteria VARCHAR(2000), VotingPanel VARCHAR(2000));
CREATE TABLE Countries(Country VARCHAR(200), MinLat REAL, MaxLat REAL, MinLong REAL, MaxLong REAL);
CREATE TABLE GenreOf(WorkID VARCHAR(200), GenreName VARCHAR(500));
CREATE TABLE Honor(AwardID VARCHAR(200) PRIMARY KEY, AwardName VARCHAR(1000) NULL, YearGiven INT NULL, NominatedWon VARCHAR(50) NULL, ShowName VARCHAR(50) NULL, WorkID VARCHAR(50) NULL, PersonName VARCHAR(100) NULL);
CREATE TABLE Locations(WorkID VARCHAR(200), Location VARCHAR(500), FilmedOrFiction VARCHAR(50), Latitude REAL NULL, Longitude REAL NULL);
CREATE TABLE Movies(WorkID VARCHAR(200) PRIMARY KEY, Title VARCHAR(500) NULL, Rating VARCHAR(10) NULL, BoxOffice REAL NULL, Budget REAL NULL, Year INT NULL);
CREATE TABLE Music( WorkID VARCHAR(50), Title VARCHAR(2000) NULL, Artist VARCHAR(100), isSingle VARCHAR(3) NOT NULL, EligibilityYear INT NULL, Genre VARCHAR(100) NULL, ReleaseYear INT NULL);
CREATE TABLE People(Name VARCHAR(200), PlaceOrigin VARCHAR(100) NULL, Occupation VARCHAR(100) NULL, Gender VARCHAR(50) NULL, Birthdate DATETIME NULL);
CREATE TABLE Pictures(WorkID VARCHAR(200), URL VARCHAR(2000), Source VARCHAR(200) NULL);
CREATE TABLE Stage( WorkID VARCHAR(50) PRIMARY KEY, Setting VARCHAR(100) NULL, Title VARCHAR(2000) NULL, Iteration INT NULL, Type VARCHAR(100) NULL, Genre VARCHAR(100) NULL, SongNumber INT NULL, YEAR INT NULL, Theatre VARCHAR(300) NULL, Open DATETIME NULL, Closed DATETIME NULL, Previews INT NULL, Performances INT NULL, Running VARCHAR(3) NOT NULL);
CREATE TABLE Television(WorkID VARCHAR(200) PRIMARY KEY, Title VARCHAR(400) NULL, Episodes INT NULL, Seasons INT NULL, StillRunning VARCHAR(3), Network VARCHAR(100) NULL, CameraSetup VARCHAR(200) NULL, MinimumRuntime INT NULL, MaximumRuntime INT NULL);
CREATE TABLE Works(WorkID VARCHAR(200), TitleName VARCHAR(500));
